const importModel = async () => {
  const model = await tf.loadLayersModel("model.json");
  modelLoaded.value = true;
  return model;
};

const clearData = () => {
  measurments.value = [];
};

const predictData = async () => {
  const model = await importModel();
  const X_widow = createData();
  const res = await model.predict(X_widow);
  if (debugMode.value) {
      alert(res);
  }
  
  // [laufen, rennen, sitzen, stehen, treppenlaufen, velofahren]
  const labels = [
    "Laufen",
    "Rennen",
    "Sitzen",
    "Stehen",
    "Treppenlaufen",
    "Velofahren",
  ];
  //const index = res.argMax(1).dataSync()[0];
  const predictions = res.argMax(1).dataSync();

  // Count the occurrences of each predicted value
  const counts = {};
  predictions.forEach((value) => {
    if (counts[value]) {
      counts[value]++;
    } else {
      counts[value] = 1;
    }
  });

  // Find the value with the maximum count
  let maxCount = 0;
  let mostCountedValue;

  Object.keys(counts).forEach((value) => {
    if (counts[value] > maxCount) {
      maxCount = counts[value];
      mostCountedValue = parseInt(value); // Convert value to an integer
    }
  });

  console.log("Most counted value:", mostCountedValue);

  const label = labels[mostCountedValue];


  const date = new Date();
  const options = { dateStyle: 'short', timeStyle: 'short' };
  const dateString = date.toLocaleString(undefined, options);

  activites.value.push({ x: `${label} ${dateString}`, Icon: label })
  measurments.value = []
  // alert the predictions and the label to the prediction
  if (debugMode.value) {
  alert(
    `Predictions: ${predictions}\n\nLabel: ${label}\n\nConfidence: ${maxCount}/${predictions.length}`
  );
  }

};


